<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Golf Course Details Selector</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 20px;
            background-color: #f4f4f9;
            color: #333;
        }
        .container {
            max-width: 1000px;
            margin: 0 auto;
            background: #fff;
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }
        h1, h2, h3 {
            color: #004d40;
            border-bottom: 2px solid #004d40;
            padding-bottom: 5px;
            margin-top: 20px;
        }
        .course-info p {
            line-height: 1.6;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 20px;
        }
        th, td {
            border: 1px solid #ddd;
            padding: 10px;
            text-align: left;
        }
        th {
            background-color: #e0f2f1;
            color: #004d40;
        }
        .location-map {
            margin-top: 15px;
            font-style: italic;
        }
        #selector-area {
            margin-bottom: 20px;
            padding: 15px;
            background-color: #ccff90;
            border-radius: 5px;
        }
        select {
            padding: 10px;
            font-size: 16px;
            border-radius: 4px;
            border: 1px solid #ccc;
            margin-right: 15px;
        }
        #holeSummary, #teeYardage {
            min-height: 150px; /* Ensure tables have space even when empty */
        }
    </style>
</head>
<body>

<div class="container">
    
    <div id="selector-area">
        <h1>‚õ≥ Select a Golf Course</h1>
        <label for="courseSelector">Choose Course Name:</label>
        <select id="courseSelector">
            <option value="" disabled selected>--- Select a Course ---</option>
            </select>
    </div>

    <div id="courseDetails">
        <div style="display: flex; align-items: center; justify-content: space-between;">
            <h1 id="courseName" style="border: none;"></h1>
            <button id="copyLinkBtn" style="padding: 10px; cursor: pointer; background: #004d40; color: white; border: none; border-radius: 4px;">
                üîó Copy Share Link
            </button>
        </div>
    <p id="courseDescription" class="course-info"></p>
        <p id="courseDescription" class="course-info"></p>

        <div id="coreInfo">
            <h2>Core Course Information</h2>
            <p><strong>Par:</strong> <span id="parValue"></span></p>
            <p><strong>Decoration:</strong> <span id="decorationValue"></span></p>
            <p><strong>Established:</strong> <span id="establishedDate"></span></p>
            <p><strong>Location:</strong> <span id="cityStateCountry"></span></p>
            <p><strong>Altitude:</strong> <span id="altitudeValue"></span></p>
            <p class="location-map"><strong>Map Coordinates:</strong> Latitude: <span id="latitudeValue"></span>, Longitude: <span id="longitudeValue"></span></p>
        </div>

        <hr>

        <div id="teeYardage">
            <h2>Tee Yardages & Ratings (All Tees)</h2>
            <table id="yardageTable">
                <thead>
                    <tr>
                        <th>Tee Name</th>
                        
                        <th>Yardage (Yards)</th>
                        <th>Rating</th>
                        <th>Slope</th>
                    </tr>
                </thead>
                <tbody>
                    </tbody>
            </table>
        </div>

        <hr>

        <div id="holeSummary">
            <h2>üèåÔ∏è Hole-by-Hole Summary</h2>
            <div style="margin-bottom: 10px;">
                <label for="teeBoxSelector">View Summary for Tee Box:</label>
                <select id="teeBoxSelector" disabled>
                    <option value="" disabled selected>--- Select a Course First ---</option>
                </select>
            </div>
            
            <table id="holeTable">
                <thead>
                    <tr>
                        <th>Hole No.</th>
                        <th>Par</th>
                        <th>Stroke Index</th>
                        <th>Distance (Yards)</th>
                    </tr>
                </thead>
                <tbody>
                    </tbody>
            </table>
        </div>
    </div>
</div>

    ];

    const courseSelector = document.getElementById('courseSelector');
    const teeBoxSelector = document.getElementById('teeBoxSelector');
    const courseDetailsDiv = document.getElementById('courseDetails');
    const copyLinkBtn = document.getElementById('copyLinkBtn');
    let activeCourse = null;

    // --- 1. Navigation & URL Logic ---

    function populateCourseSelector() {
        courseData.forEach((course, index) => {
            const option = document.createElement('option');
            option.value = index; 
            option.textContent = course.Name;
            courseSelector.appendChild(option);
        });
        
        courseSelector.addEventListener('change', (event) => {
            const selectedIndex = event.target.value;
            if (selectedIndex !== "") {
                selectCourseByIndex(selectedIndex);
            }
        });
    }

    function selectCourseByIndex(index) {
        activeCourse = courseData[index];
        courseSelector.value = index;
        displayCourseDetails(activeCourse);
        populateTeeBoxSelector(activeCourse);
        
        // Update URL bar without reloading
        const newUrl = window.location.protocol + "//" + window.location.host + window.location.pathname + '?course=' + encodeURIComponent(activeCourse.Name);
        window.history.pushState({path:newUrl},'',newUrl);
    }

    copyLinkBtn.addEventListener('click', () => {
        if (activeCourse) {
            navigator.clipboard.writeText(window.location.href).then(() => {
                const originalText = copyLinkBtn.textContent;
                copyLinkBtn.textContent = "‚úÖ Link Copied!";
                setTimeout(() => copyLinkBtn.textContent = originalText, 2000);
            });
        }
    });

    function checkURLParameters() {
        const urlParams = new URLSearchParams(window.location.search);
        const courseNameQuery = urlParams.get('course');
        if (courseNameQuery) {
            const courseIndex = courseData.findIndex(
                c => c.Name.toLowerCase() === courseNameQuery.toLowerCase()
            );
            if (courseIndex !== -1) selectCourseByIndex(courseIndex);
        }
    }

    // --- 2. Data Rendering Functions (The ones you already had) ---

    function displayCourseDetails(course) {
        courseDetailsDiv.style.display = 'block'; 
        document.getElementById('courseName').textContent = course.Name;
        document.getElementById('courseDescription').textContent = course.Description;
        document.getElementById('parValue').textContent = course.Par;
        document.getElementById('decorationValue').textContent = course.Decoration;
        document.getElementById('establishedDate').textContent = course.EstablishedDate;
        document.getElementById("altitudeValue").textContent = course.Altitude;

        const stateParts = course.State.split(',');
        const stateName = stateParts.length > 0 ? stateParts[0].trim() : course.State;
        document.getElementById('cityStateCountry').textContent = `${course.City}, ${stateName}, ${course.Country}`;
        
        document.getElementById('latitudeValue').textContent = course.Latitude;
        document.getElementById('longitudeValue').textContent = course.Longitude;

        const yardageTableBody = document.querySelector('#yardageTable tbody');
        yardageTableBody.innerHTML = '';
        course.Yardage.forEach(tee => {
            const row = yardageTableBody.insertRow();
            row.insertCell().textContent = tee.TeeName;
            row.insertCell().textContent = tee.Yardage.toLocaleString();
            row.insertCell().textContent = tee.Rating;
            row.insertCell().textContent = tee.Slope;
        });
    }

    function populateTeeBoxSelector(course) {
        teeBoxSelector.innerHTML = '';
        teeBoxSelector.disabled = false;
        
        const defaultOption = document.createElement('option');
        defaultOption.value = "";
        defaultOption.textContent = "--- Select a Tee Box ---";
        defaultOption.disabled = true;
        teeBoxSelector.appendChild(defaultOption);

        course.Yardage.forEach(tee => {
            const option = document.createElement('option');
            option.value = tee.TeeRef;
            option.textContent = tee.TeeName;
            teeBoxSelector.appendChild(option);
        });

        teeBoxSelector.onchange = () => {
            if (activeCourse) renderHoleSummary(activeCourse, teeBoxSelector.value);
        };

        if (course.Yardage.length > 0) {
            teeBoxSelector.value = course.Yardage[0].TeeRef;
            renderHoleSummary(course, teeBoxSelector.value);
        }
    }

    function renderHoleSummary(course, teeRef) {
        const holeTableBody = document.querySelector('#holeTable tbody');
        holeTableBody.innerHTML = '';
        const holes = course.Areas.filter(area => area.AreaType === "Hole");
        
        if (holes.length === 0) {
            holeTableBody.innerHTML = '<tr><td colspan="4">No hole data available.</td></tr>';
            return;
        }

        holes.sort((a,b) => a.HoleNo - b.HoleNo).forEach(hole => {
            const teeData = hole.Tees.find(tee => tee.TeeRef === teeRef); 
            const row = holeTableBody.insertRow();
            row.insertCell().textContent = hole.HoleNo;
            if (teeData) {
                row.insertCell().textContent = teeData.Par;
                row.insertCell().textContent = teeData.StrokeIndex;
                row.insertCell().textContent = teeData.Distance.toLocaleString();
            } else {
                row.insertCell().innerHTML = '<em>N/A</em>';
                row.insertCell().innerHTML = '<em>N/A</em>';
                row.insertCell().innerHTML = '<em>N/A</em>';
            }
        });
    }

    // --- 3. Initialization ---
    courseDetailsDiv.style.display = 'none';
    populateCourseSelector();
    checkURLParameters();
</script>
